import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/portfolio">Portfolio</Link>
            </li>
            <li>
              <Link to="/interests">Interests</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/portfolio">
            <Portfolio />
          </Route>
          <Route path="/interests">
            <Interests />
          </Route>
        </Switch>
      </div>
    </Router>
  )
}

const Home = () => {
  return (
    <h2>Home</h2>
  )
}

const Portfolio = () => {
  return (
    <h2>Portfolio</h2>
  )
}

const Interests = () => {
  return (
    <h2>Interests</h2>
  )
}

export default App;
